def find_primes_between_indices(int_list):
    def is_prime(num):
        if num <= 1:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    primes = [x for x in int_list[28:84] if is_prime(x)]
    primes.sort()

    return primes
